    return (
        <div className={styles.backgraund__button}>
            <div>
                <button onClick={(event) => {
                    alert('Hello Victor!')
                }} className={styles.btn1}>My firs Chanel #1
                </button>
            </div>
            <div>
                <button onClick={myFirstSubscriber} className={styles.btn1}>My firs Chanel #2
                </button>
            </div>
        </div>
    );
};
